import {
  AppBar,
  Tabs,
  Tab,
  Grid,
  Toolbar,
  useMediaQuery,
  useTheme,
  Typography,
} from "@mui/material";
import React, { useState } from "react";
import { styled } from "@mui/material/styles";
import Paper from "@mui/material/Paper";

import { Link } from "react-router-dom";
import AS from "../logo.png";
import DrawerComp from "./DrawerComp";
const PAGES = ["Sample01", "Sample02", "SignUp", "SignIn", "SignOut"];

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "light" ? "#074588" : "light",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export const Header = () => {
  const [value, setValue] = useState();
  const theme = useTheme();
  console.log(theme);
  const isMatch = useMediaQuery(theme.breakpoints.down("md"));
  console.log(isMatch);

  return (
    <React.Fragment>
      <AppBar sx={{ background: "#063970" }}>
        <Toolbar>
          {isMatch ? (
            <div>

              <Grid
                container
                direction="row"
                justifyContent="space-between"
                alignItems="center"
              >
                <Grid >
                  <Item>
                    <DrawerComp />
                  </Item>
                </Grid>
                <Grid container
                direction="row"
                justifyContent="space-between"
                alignItems="center">

                  <Link to="/">
                    <img
                      src={"https://cdn.worldvectorlogo.com/logos/redbull.svg"}
                      alt="logo"
                      height={50}
                    />
                  </Link>
                </Grid>
                <Grid >h</Grid>
              </Grid>
            </div>
          ) : (
            <div>
              <Link to="/" sx={{ paddingLeft: "50%" }}>
                <img
                  src={"https://cdn.worldvectorlogo.com/logos/redbull.svg"}
                  alt="logo"
                  marginLeft="auto"
                  height={50}
                />
              </Link>
              <Tabs
                sx={{ marginLeft: "auto" }}
                value={value}
                textColor="inherit"
                indicatorColor="secondary"
                onChange={(e, value) => setValue(value)}
              >
                {PAGES.map((page, index) => (
                  <Tab key={index} label={page} />
                ))}
              </Tabs>
            </div>
          )}
        </Toolbar>
      </AppBar>
    </React.Fragment>
  );
};
